import React from "react";

function MovieList({ items }) {
    return (
        <section className="movie-list">
            {items.map((item, index) => (
                <article className="movie-item" key={index}>
                    {index + 1}
                    {item}
                </article>
            ))}
        </section>
    );
}

export default MovieList;
